import React from 'react';

function NotFound() {
    return ( 
        <div className='container' style={{color:"#424242"}}>
            <div className='row'>
                <div className='col-6'>
                <h6>404</h6>
                <h1>Kiaan couldn’t find that page</h1>
                <p style={{marginTop:"10px"}}>We couldn’t find the page you were looking for.Visit<a href="/">Zerodha's Home </a></p>
                </div>
            </div>
        </div>
     );
}

export default NotFound;
